import { Component } from "react"
import '../assets/css/style.css';

class Fotoscopy extends Component {

    //defino el state para mostrarlo dentro de la pagina y defino la propiedad q se va a llamar fotos por ej.
    state = {
        fotos: [
            { nombre: 'andy', estudio: 'almendrales', imagen: '../assets/img/galeria/andy6.jpg' },
            { nombre: 'luca', estudio: 'almendrales', imagen: '../assets/img/galeria/luca.jpg' },
            { nombre: 'rivera', estudio: 'el infierno', imagen: '../assets/img/galeria/rivera1.jpg' },
            { nombre: 'martin', estudio: 'brasil', imagen: '../assets/img/galeria/martin6.jpg' },

        ]
    }

    render() {
        return (
            <div>
                <div id="galeria" className="servicio-estudio container">
                    <h2>Galeria</h2>
                </div>
                <div className="lista-equipos container">
                    <figure className="galeria-foto">
                        <img src={andy}></img>
                    </figure>
                </div>
            </div>
        );
    }
}


export default Fotoscopy;
